import {
	AbsoluteFill,
	interpolate,
	spring,
	useCurrentFrame,
	useVideoConfig,
	Img,
} from 'remotion';
import { interpolate, spring, useCurrentFrame, useVideoConfig } from 'remotion';

export const useTranslate = ({
    from,
    to,
    startAtFrame = 0,
}) => {
    const { fps } = useVideoConfig();
    const frame = useCurrentFrame();

    const animation = spring({
        frame: frame - startAtFrame,
        fps,
        config: { damping: 200 },
    });

    return interpolate(animation, [0, 1], [from, to]);
};

export const Logo = () => {
	const videoConfig = useVideoConfig();
	const { fps } = useVideoConfig();
	const frame = useCurrentFrame();
    const translateX = useTranslate({ from: 0, to: 0, startAtFrame: fps });
    const translateY = useTranslate({ from: 150, to: -1100, startAtFrame: fps });
    const scale = useTranslate({ from: 1, to: 0.3, startAtFrame: fps * 0.95 });
    const opacity = useTranslate({ from: 1, to: 0, startAtFrame: fps});
	return (
		<AbsoluteFill
			style={{
				    left: translateX, top: translateY, textAlign: 'center', margin: '0 auto', opacity, transform: 'scale('+scale+')'
			}}
		>
            <Img src="data:image/svg+xml;base64,"/>
		</AbsoluteFill>
	);
};
